import React from "react";
import { Button, Layout, Avatar, Dropdown } from "antd";
import "./index.css";
import {
  MenuFoldOutlined,
  MenuUnfoldOutlined,
  UploadOutlined,
  UserOutlined,
  VideoCameraOutlined,
  SmileOutlined,
} from "@ant-design/icons";

const { Header, Sider, Content } = Layout;

const CommonHeader = () => {
  const logout = () => {};
  const items = [
    {
      key: "1",
      label: (
        <a target="_blank" rel="noopener noreferrer">
          My Page
        </a>
      ),
    },
    {
      key: "2",
      label: (
        <a conClick={() => logout} target="_blank" rel="noopener noreferrer">
          log out
        </a>
      ),
      icon: <SmileOutlined />,
      disabled: true,
    },
  ];
  return (
    <Header className="header-container">
      <Button
        type="text"
        icon={<MenuFoldOutlined />}
        style={{
          fontSize: "16px",
          width: 64,
          height: 32,
          backgroundColor: "#fff",
        }}
      />
      <Dropdown>
        menu={{ items }}
        <Avatar
          size={36}
          src={
            <img
              src={require("../../assets/images/user.png")}
              alt="User Avatar"
            />
          }
        />
      </Dropdown>
    </Header>
  );
};

export default CommonHeader;
